template.helper("parseInt",function(e){return parseInt(e)}),template.helper("fisrtWeek",function(e,t){return new Date(e,t-1,1).getDay()}),template.helper("currDays",function(e,t){return new Date(e,t,0).getDate()}),template.helper("formatTime",function(e,t,n){t=String(t);for(var r=0,a="";r<2-t.length;r++)a+="0";return e+"-"+a+t+"-"+n}),template.helper("checkStart",function(e,t,n,r){return new Date(e,t-1,n).getTime()==new Date(r+" 0:0:0").getTime()}),template.helper("checkEnd",function(e,t,n,r){return new Date(e,t-1,n).getTime()==new Date(r+" 0:0:0").getTime()});